import { BrowserRouter, Routes, Route } from "react-router-dom";

import CartPage from "./components/CartPage";
import LoginPage from "./components/LoginPage";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<CartPage />} />;
      </Routes>
    </BrowserRouter>
  );
}

export default App;
